import React, { useState } from "react";
// import axios from 'axios';


const Assigntutor = () => {

  const [query, setQuery] = useState("");
  const [results, setResults] = useState([]);


  const handleInputChange = (event) => {
    setQuery(event.target.value);
    console.log(event.target.value)

  };

  
  const handleSearch = (event) => {
    event.preventDefault();
  
   
    fetch(`http://localhost:5000/tutorregister?primelocation=${query}`)
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setResults(data);
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };



return (
  <div className="abc">

  <form onSubmit={handleSearch}>
    <input
      type="text"
      placeholder="Search..."
      value={query}
      name="query"
      onChange={handleInputChange}
    />

      <button type="submit">Search</button>
      </form>
      {results.length > 0 && results.map((result,index) =>(
    <div key={index}>
      <p>Name :{result.name}</p>
      <p>Email: {result.email}</p>
      <p>Education: {result.education}</p>
      <p>Contact number: {result.contactNumber}</p>
      <p>Prime Location: {result.primelocation}</p>
      <p>Subjects: {result.subjects}</p>
    </div>
  ))}

</div>

)
}

export default Assigntutor;

